                "value"  =>  "<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><paragraph><link target=\"_blank\" xhtml:id=\"internal-source-marker_0.15448186383582652\" url_id=\"25\">Forums</link>,&amp;nbsp;<link target=\"_blank\" url_id=\"26\">Blogs</link>,&amp;nbsp;<link target=\"_blank\" url_id=\"27\">Twitter</link>,&amp;nbsp;<link target=\"_blank\" url_id=\"28\">LinkedIn</link></paragraph></section>",
