                "value"  =>  "<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\"><section><paragraph>To provide you with full control over your website, eZ Publish has many features that make it easy to manage both content and users.</paragraph></section></section>",
