        702  =>  new \eZ\Publish\API\Repository\Values\Content\Field(
            array(
                "id"  =>  702,
                "value"  =>  "<section xmlns:image=\"http://ez.no/namespaces/ezpublish3/image/\" xmlns:xhtml=\"http://ez.no/namespaces/ezpublish3/xhtml/\" xmlns:custom=\"http://ez.no/namespaces/ezpublish3/custom/\"><section><header>Introduction</header><paragraph>Users of eZ Publish sometimes wonder if it is possible to make use of a single installation of eZ Publish for multiple websites. The answer is yes through the power of the siteaccess. In fact, an understanding of siteaccesses gives one the ability to do much more than just host multiple sites in one installation. With this technique you can:</paragraph><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\"><ul><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">make it easier to share content between databases</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">copy and add locations to objects</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">use a single Premium agreement and one eZ Network extension for multiple sites with the same or different content</paragraph></li><li><paragraph xmlns:tmp=\"http://ez.no/namespaces/ezpublish3/temporary/\">simplify eZ Publish upgrades by consolidating several sites on one installation</paragraph></li></ul></paragraph><paragraph>This is demo content, to continue real reading, please visit&amp;nbsp;<link target=\"_blank\" url_id=\"93\">share.ez.no</link></paragraph></section><section><header>About the author : Greg McAvoy-Jensen</header><paragraph>Greg is the executive director of&amp;nbsp;<link target=\"_blank\" xhtml:title=\"Granite Horizon\" url_id=\"94\">Granite Horizon</link>, one of the largest eZ Publish development firms in the United States of America. A certified eZ Publish developer, he has served clients and trained developers on four continents since he started working with eZ Publish in 2003. His wife Heather and he are proud parents of three wonderful children.</paragraph></section></section>",
